import React from "react";
import { useState } from "react";

const Counter = () => {
  const [count, setCount] = useState(0);

  return (
    <React.Fragment>
      <div>Counter</div>
      <h1>{count}</h1>
    </React.Fragment>
  );
};

export default Counter;
